     <!-- m_editable region-id="editable-static-tag-U9429-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
     <div class="clearfix colelem shared_content" id="u9429-4" data-muse-uid="U9429" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u9429-4_content"><!-- content -->
      <p id="u9429-2">O Programa Longevidade é um programa de relacionamento com dicas e serviços que serão úteis para seu tratamento, fornecendo inclusive, descontos na compra de alguns medicamentos da Torrent Pharma prescritos pelo seu médico. Você ainda poderá obter informações sobre saúde e qualidade de vida neste site. É muito simples fazer parte deste programa, veja como funciona.</p>
     </div>
     <!-- /m_editable -->
     <div class="clearfix colelem shared_content" id="pu9495" data-content-guid="pu9495_content"><!-- group -->
      <div class="browser_width grpelem" id="u9495-bw">
       <div id="u9495"><!-- group -->
        <div class="clearfix" id="u9495_align_to_page">
         <!-- m_editable region-id="editable-static-tag-U9472-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
         <div class="clearfix grpelem" id="u9472-7" data-muse-uid="U9472" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc"><!-- content -->
          <p id="u9472-2">Verifique se o produto prescrito pelo seu médico consta da lista abaixo. Esses são os produtos participantes do Programa Longevidade:</p>
          <p id="u9472-3">&nbsp;</p>
          <p id="u9472-5">Neblock</p>
         </div>
         <!-- /m_editable -->
        </div>
       </div>
      </div>
