     <div class="clearfix colelem shared_content" id="pu9643" data-content-guid="pu9643_content"><!-- group -->
      <div class="browser_width grpelem" id="u9643-bw">
       <div id="u9643"><!-- group -->
        <div class="clearfix" id="u9643_align_to_page">
         <!-- m_editable region-id="editable-static-tag-U9646-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
         <div class="clearfix grpelem" id="u9646-4" data-muse-uid="U9646" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc"><!-- content -->
          <p>Seu médico prescreveu um medicamento que faz parte do Programa Longevidade. Tenha em mãos a receita, seu nome e número do CRM ou com o carimbo do seu médico.</p>
