     <div class="clearfix colelem shared_content" id="pu9714" data-content-guid="pu9714_content"><!-- group -->
      <div class="browser_width grpelem" id="u9714-bw">
       <div id="u9714"><!-- group -->
        <div class="clearfix" id="u9714_align_to_page">
         <!-- m_editable region-id="editable-static-tag-U9717-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
         <div class="clearfix grpelem" id="u9717-5" data-muse-uid="U9717" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc"><!-- content -->
          <p>Após o cadastro, você poderá fazer a compra do medicamento informando à farmácia o seu CPF. São mais de 47.000 pontos de venda no Brasil que podem <span id="u9717-2"><a class="nonblock nontext" href="/farmacias">ser consultados aqui.</a></span></p>
