     <!-- m_editable region-id="editable-static-tag-U9939-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
     <div class="clearfix colelem shared_content" id="u9939-17" data-muse-uid="U9939" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u9939-17_content"><!-- content -->
      <p id="u9939-2">Recomendações</p>
      <p id="u9939-4">Observe atentamente o período de tratamento indicado pelo seu médico na prescrição. Respeite a prescrição do seu médico. Não tome medicamentos por conta própria.</p>
      <p id="u9939-5">&nbsp;</p>
      <p id="u9939-7">Validade</p>
      <p id="u9939-9">A Torrent Pharma reserva-se o direito de alterar ou interromper o programa Programa Longevidade a qualquer momento, sem aviso prévio.</p>
      <p id="u9939-10">&nbsp;</p>
      <p id="u9939-12">Dúvidas frequentes</p>
      <p id="u9939-14">Abaixo selecionamos as perguntas mais recorrentes recebidas em nossa central de atendimento. Utilize as caixas de seleção abaixo, e veja se a sua questão se encontra disponível em um delas.</p>
      <p id="u9939-15">&nbsp;</p>
     </div>
     <!-- /m_editable -->
     <ul class="AccordionWidget rounded-corners clearfix colelem" id="accordionu9960"><!-- vertical box -->
      <li class="AccordionPanel clearfix colelem" id="u9969"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U9972-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u9972-4" data-muse-uid="U9972" data-muse-type="txt_frame"><!-- content --><div id="u9972-3" class="shared_content" data-content-guid="u9972-3_content"><p id="u9972-2">☉ Qual é o desconto concedido?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent clearfix colelem" id="u9970"><!-- group --><!-- m_editable region-id="editable-static-tag-U9971-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u9971-4" data-muse-uid="U9971" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u9971-4_content"><!-- content --><p>O desconto é concedido sobre o Preço Máximo ao Consumidor* e varia de acordo com o produto selecionado. O percentual exato do desconto é informado no final do cadastro. *O Preço Máximo ao Consumidor é determinado pelo Governo Federal.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u9965"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U9966-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u9966-4" data-muse-uid="U9966" data-muse-type="txt_frame"><!-- content --><div id="u9966-3" class="shared_content" data-content-guid="u9966-3_content"><p>☉ Como faço para me cadastrar?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u9967"><!-- group --><!-- m_editable region-id="editable-static-tag-U9968-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link" --><div class="clearfix grpelem shared_content" id="u9968-4" data-muse-uid="U9968" data-muse-type="txt_frame" data-content-guid="u9968-4_content"><!-- content --><p>Cadastrar-se no Programa Longevidade é muito simples. Basta ter em mãos seus dados pessoais (nome, endereço e CPF) e os dados da receita médica (quando o produto exigir prescrição). Depois, basta preencher o formulário aqui e pronto! Seu CPF já estará validado para a compra em qualquer um dos 47.000 pontos de venda credenciados ao Programa Longevidade.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u9961"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U9962-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u9962-4" data-muse-uid="U9962" data-muse-type="txt_frame"><!-- content --><div id="u9962-3" class="shared_content" data-content-guid="u9962-3_content"><p>☉ Onde posso comprar?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u9963"><!-- group --><!-- m_editable region-id="editable-static-tag-U9964-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u9964-4" data-muse-uid="U9964" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u9964-4_content"><!-- content --><p>O Programa Longevidade possui mais de 47.000 farmácias credenciadas. A lista completa pode ser consultada aqui</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u10205"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U10206-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u10206-4" data-muse-uid="U10206" data-muse-type="txt_frame"><!-- content --><div id="u10206-3" class="shared_content" data-content-guid="u10206-3_content"><p>☉ Por que não posso comprar em qualquer farmácia?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u10207"><!-- group --><!-- m_editable region-id="editable-static-tag-U10370-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u10370-4" data-muse-uid="U10370" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u10370-4_content"><!-- content --><p>O credenciamento de farmácias depende de uma série de fatores: desejo da farmácia em fazer parte da rede, condições técnicas, condições comerciais, entre outros fatores. Hoje, você pode encontrar o Programa Longevidade em mais de 47.000 farmácias no Brasil todo, incluindo-se as grandes redes.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u10216"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U10218-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u10218-4" data-muse-uid="U10218" data-muse-type="txt_frame"><!-- content --><div id="u10218-3" class="shared_content" data-content-guid="u10218-3_content"><p>☉ Meu cadastro expira?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u10217"><!-- group --><!-- m_editable region-id="editable-static-tag-U10373-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u10373-4" data-muse-uid="U10373" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u10373-4_content"><!-- content --><p>Seu cadastro no programa não expira, mesmo que fique um tempo sem comprar e depois volte a adquirir o medicamento. No entanto, pode ocorrer do produto para o qual você está cadastrado sair do programa. Neste caso, não será mais possível comprá-lo por meio do Programa Longevidade.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u10225"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U10227-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u10227-4" data-muse-uid="U10227" data-muse-type="txt_frame"><!-- content --><div id="u10227-3" class="shared_content" data-content-guid="u10227-3_content"><p>☉ Consigo efetuar a compra com desconto apenas com meu CPF?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u10226"><!-- group --><!-- m_editable region-id="editable-static-tag-U10376-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u10376-4" data-muse-uid="U10376" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u10376-4_content"><!-- content --><p>A Torrent do Brasil mudou a forma de identificação na farmácia. Você pode simplesmente mencionar o número do seu CPF ao balconista. Mais rápido e prático!</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u10234"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U10235-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u10235-4" data-muse-uid="U10235" data-muse-type="txt_frame"><!-- content --><div id="u10235-3" class="shared_content" data-content-guid="u10235-3_content"><p>☉ Preciso fazer um novo cadastro para aderir a outro produto?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u10236"><!-- group --><!-- m_editable region-id="editable-static-tag-U10379-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u10379-4" data-muse-uid="U10379" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u10379-4_content"><!-- content --><p>Quando você faz um cadastro no Programa Longevidade, precisa informar o produto que tomará. Será liberada a compra desse produto apenas. Com uma nova prescrição, será necessário apenas informar os dados novos - produto e os dados do médico. Basta fazer o login aqui e acrescentar o novo medicamento. É muito fácil recuperar ou criar a sua senha!</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u10243"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U10244-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u10244-4" data-muse-uid="U10244" data-muse-type="txt_frame"><!-- content --><div id="u10244-3" class="shared_content" data-content-guid="u10244-3_content"><p>☉ Por que nem todos os produtos estão no programa?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u10245"><!-- group --><!-- m_editable region-id="editable-static-tag-U10382-BP_infinity" template="programa.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u10382-4" data-muse-uid="U10382" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u10382-4_content"><!-- content --><p>Os produtos estão entrando gradativamente no Programa Longevidade e dependem de vários fatores. Visite regularmente o nosso website para saber quais produtos estão incluídos no programa.</p></div><!-- /m_editable --></div></li>
     </ul>
